function GetDataStorage(n,t,i){var r=GetSearchParam(n,t,i);HttpPost(`/SearchByParameterDoc/GetDocHistory`,"html",r,function(n){$("#LoadView").html("");$("#LoadView").html(n)})}function GetSearchParam(n,t){return{FileNo:$("#FileNo").val(),pageSize:parseInt(t),pageNumber:parseInt(n)}}function onPaging(n){GetDataStorage(parseInt(n),parseInt(currentPageSize),sortby);currentPageNumber=n;currentPageNumber=n}function onChangePageSize(n){GetDataStorage(parseInt(currentPageNumber),parseInt(n),sortby);currentPageSize=n}var currentPageNumber=1,currentPageSize=10,sortby=1;$(document).ready(function(){GetDataStorage(currentPageNumber,currentPageSize,sortby)});$("#btnPrint").click(function(){window.print()});